import forgotPassword from '/home/dckap/Documents/React real/src/assets/images/forgotpassword.png';


export default function ForgotPassword() {
    return (

        <main className="flex">
            <div className='bg-secondary h-screen w-1/2 p-28' >
                <div>
                    <h1>Forgot Your Password?</h1>
                </div>
            </div>
            <div className='bg-primary w-1/2 h-screen'>
                <img src={forgotPassword} alt=""  className='p-16'/>
            </div>


        </main>


    )
}
